import React, { useState } from 'react';

const App = () => {
    const [key, setKey] = useState('');
    const [value, setValue] = useState('');
    const [hashType, setHashType] = useState('extendible');
    const [result, setResult] = useState(null);
    const [error, setError] = useState(null);

    const handleInsert = async () => {
        setError(null); // Reset error before each request
        const response = await fetch(`/${hashType}/insert`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ key: parseInt(key), value })
        });

        if (response.ok) {
            const data = await response.json();
            setResult(data); // Display the current state of the hash table
        } else {
            const errorData = await response.json();
            setError(errorData.error || "An error occurred while inserting.");
        }
    };

    const handleSearch = async () => {
        setError(null);
        const response = await fetch(`/${hashType}/search?key=${key}`);
        if (response.ok) {
            const data = await response.json();
            setResult(data); // Display the found value
        } else {
            const errorData = await response.json();
            setError(errorData.error || "An error occurred while searching.");
        }
    };

    const handleDelete = async () => {
        setError(null);
        const response = await fetch(`/${hashType}/delete`, {
            method: 'DELETE',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ key: parseInt(key) })
        });

        if (response.ok) {
            const data = await response.json();
            setResult(data); // Display the current state of the hash table
        } else {
            const errorData = await response.json();
            setError(errorData.error || "An error occurred while deleting.");
        }
    };

    return (
        <div>
            <h1>Hashing Example</h1>
            <select onChange={(e) => setHashType(e.target.value)} value={hashType}>
                <option value="extendible">Extendible Hashing</option>
                <option value="linear">Linear Hashing</option>
            </select>
            <input
                type="number"
                placeholder="Key"
                value={key}
                onChange={(e) => setKey(e.target.value)}
            />
            <input
                type="text"
                placeholder="Value"
                value={value}
                onChange={(e) => setValue(e.target.value)}
            />
            <button onClick={handleInsert}>Insert</button>
            <button onClick={handleSearch}>Search</button>
            <button onClick={handleDelete}>Delete</button>
            
            {/* Display result or error message */}
            {result && <pre>Result: {JSON.stringify(result, null, 2)}</pre>}
            {error && <pre style={{ color: 'red' }}>Error: {error}</pre>}
        </div>
    );
};

export default App;
